export default function ChickProduction(props) {
    const { chick } = useParams();
    const { pathname, state } = useLocation(); // hook to enable us get the pathname, and state sent from clicking the link

    return (
        <div>
            Chick production data...
            <div>{chick}</div>
            {JSON.stringify(state)}
        </div>
    )
}
